import React from 'react';
import "../style/Home.css";

function showReturnDate() {
    var x = document.getElementById("returnDate");
    if (x.style.display === "none") {
      x.style.display = "block";
    } else {
      x.style.display = "none";
    }
  }

function Home() {
    return (
        <div className="App">
            <script src="https://unpkg.com/vue@3"></script>
            <script src="https://cdn.jsdelivr.net/npm/vue/dist/vue.js"></script>
            <div class="header" className="App-header">
                <h1>dinoSOAR</h1>
            </div>
            <div className="App-body">
                <h2>Search for Flights!</h2>

                <p>Chose flight option</p>
                <div class="btn-flight-opt">
                    <button>One Way</button>
                    <button onclick="showReturnDate()">Round Trip</button>
                </div>

                <form action="/results">
                    <label for="from">From:</label>
                    <input type="text" id="from" name="from" />

                    <label for="to">To:</label>
                    <input type="text" id="to" name="to"/><br></br>

                    <label for="departDate">Departure Date:</label>
                    <input type="date" id="departDate" name="departDate"/>

                    <label for="returnDate">Return Date:</label>
                    <input type="date" id="returnDate" name="returnDate"/><br></br>
                    <br></br>


                    <input type="radio" id="noLayover" name="numLayovers" value="Non-stop"/>
                    <label for="noLayover">Non-stop</label>
                    <input type="radio" id="oneLayover" name="numLayovers" value="1 Stop"/>
                    <label for="oneLayover">1 Stop</label>
                    <input type="radio" id="twoLayover" name="numLayovers" value="2 Stop"/>
                    <label for="twoLayover">2 Stops</label><br></br><br></br>

                    <input type="submit" value="Search"></input>
                </form>
            </div>



        </div>
    );
}

export default Home;
